  <title>
   BETTRMAX AI | Chat Intelligence
  </title>
  <link href="https://fonts.googleapis.com/css2?family=Orbitron:wght@500&amp;display=swap" rel="stylesheet"/>
  <style>
   body {
      margin: 0;
      font-family: 'Orbitron', sans-serif;
      background: linear-gradient(180deg, #0a0f24 0%, #060913 100%);
      color: #ffffff;
      text-align: center;
      padding: 30px;
    }
    .logo {
      max-width: 160px;
      margin: 0 auto 30px;
    }
    h1 {
      font-size: 2.2rem;
      color: #5dfcff;
      margin-bottom: 10px;
    }
    .chat-ui {
      max-width: 800px;
      margin: 20px auto;
      background: #121b2f;
      border-radius: 16px;
      padding: 20px;
      box-shadow: 0 0 10px #5dfcff44;
    }
    .chat-ui input {
      width: 70%;
      padding: 12px;
      font-size: 1rem;
      border-radius: 8px;
      border: none;
      margin-top: 10px;
    }
    .chat-ui button {
      padding: 12px 20px;
      font-size: 1rem;
      margin-left: 10px;
      background: #5dfcff;
      color: #0a0f24;
      border: none;
      border-radius: 8px;
      font-weight: bold;
      cursor: pointer;
    }
    .response {
      margin-top: 20px;
      font-size: 1rem;
      color: #5dfcff;
      min-height: 40px;
    }
  </style>
